import React from 'react';
import styled from 'styled-components';

function Footer() {
	return <FooterContainer>Footer</FooterContainer>;
}

const FooterContainer = styled.footer`
	width: 90%;
	max-width: 1060px;
	margin: 0 auto 18px;
	display: -ms-flexbox;
	display: flex;
`;

export default Footer;
